import "../Styles/RetailerPage.css";
export default function RetailerTable(props) {
  const { retailers } = props;
  return (
    <div>
      <h2>Retailer table</h2>
      <table className="table">
        <thead>
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>Role</th>
            <th>Actions</th>
          </tr>
        </thead>

        <tbody>
          {retailers.data.map((ele) => {
            return (
              <tr>
                <td>{ele.name}</td>
                <td>{ele.email}</td>
                <td>{ele.role}</td>
                <td>
                  <button>View Details</button>
                </td>
              </tr>
            );
          })}
        </tbody>
      </table>
    </div>
  );
}
